import React from "react";

const Home = () => {
  return (
    <div class="container-xl">
      <div class="card mb-3 m-4">
        <div class="card-body">
          <h1 class="card-title text-center">Card title</h1>
        </div>
      </div>
    </div>
  );
};

export default Home;
